export default function TodoList(){
    useEffect(() => {
        fetch('/api/todo_list?format=json')
        .then(response => response.json())
        .then(data => console.log(data))
    })
    return(
        <>
        <div className="registrationDiv">
            <p>Todo List</p>
            <p>{data}</p>
        </div>          
        </>
    )
}
